import React, { Component } from 'react';

class UserPage extends Component {
  state = { users: [] }

  componentDidMount(){
    fetch("/users")
      .then(res => res.json())
      .then(users => this.setState({ users }))
  }
  render() {
    return (
      <div>Users Page</div>
    );
  }

}

export default UserPage;
